    render() {
        return (
            <ul>
                <li>
                    <CardNota />
                </li>

                <li>
                    <CardNota />
                </li>
                
                <li>
                    <CardNota />
                </li>

            </ul>
        );
    }
}

export default ListaDeNotas;
